import { BrowserRouter, Routes, Route } from "react-router-dom";

import Layout from "./Layout";
import Home from "./Home";



import Men from "./Men";
import Homemen from "./Homemen";
import Tshirts from "./Tshirts";
import Shirts from "./Shirts";
import Pants from './Pants';
import Shorts from './'
import Women from "./Women";
import Kids from "./Kids";
import Account from "./Account";
import Wtshirts from "./Wtshirts";
import Wpants from "./Wpants";
import Wkurti from "./Wkurti";




const App=()=>
{
return(
<>
   <BrowserRouter>
      <Routes>
          <Route path="/" element={<Layout />} >
            <Route index element={<Home /> } />
            <Route path="home" element={<Home />} />
            <Route path="men" element={<Men/>} >
            <Route index element={<Homemen /> } />
             <Route path="tshirts" element={<Tshirts/>} />
             <Route path="shirts" element={<Shirts/>} />
             <Route path="pants" element={<Pants/>} />
             <Route path="shorts" element={<Shorts/>} />

            </Route>

            <Route path="women" element={<Women/>} >
            <Route index element={<Homemen /> } />
             <Route path="wtshirts" element={<Wtshirts/>} />
             <Route path="wshirts" element={<Wtshirts/>} />
             <Route path="wpants" element={<Wpants/>} />
             <Route path="wkurti" element={<Wkurti/>} />

            </Route>



            <Route path="Kids" element={<Kids/>} />
            <Route path="account" element={<Account/>} />
          </Route>
      </Routes>
   </BrowserRouter>
  </> 
  );
}
export default App;
